import React from 'react';
import logo from '../../assets/logos/shutterstock-logo.jpg'
import './NavBar.scss'

function BottomNav() {
    return (
        <div className="nav-bar">
            <div className="nav-bar">
                <img src= {logo} alt = "logo" className='nav-bar__logo'></img>
                
            </div>
        </div>
    )
}

export default BottomNav
